import React, { Component } from "react";
import Chart from "react-apexcharts";

class RadialChart extends Component {
   constructor(props) {
     super(props);
      this.state = {
        series: [10],
        options: {
         chart: {
           type: 'radialBar',
           height: 350,
         },
         plotOptions: {
            radialBar: {
              startAngle: -135,
              endAngle: 225,
              hollow: {
                margin: 0,
                size: "70%",
                background: "#fff",
                image: undefined,
                imageOffsetX: 0,
                imageOffsetY: 0,
                position: "front",
                dropShadow: {
                  enabled: true,
                  top: 3,
                  left: 0,
                  blur: 4,
                  opacity: 0.24
                }
              }
            }
          },
          track: {
              background: "#fff",
              strokeWidth: "67%",
              margin: 0, // margin is in pixels
              dropShadow: {
                enabled: true,
                top: -3,
                left: 0,
                blur: 4,
                opacity: 0.35
              }
            },
         labels: ['Recouped'],
        },
      };
    }



  render() {
    return (
      <div id="chart-radial">
        <Chart
          options={this.state.options}
          series={this.state.series}
          type="radialBar"
          height={350}
          width={280}/>
      </div>
      );
    }
  }

export default RadialChart;
